import React from 'react'
import Project from './Project'

const ListProject = () => {
    const projects = [
        {
            name: 'project 1'
        },
        {
            name: 'project 2'
        },{
            name: 'project 3'
        },
    ]
    return ( 
        <ul className="list-project">
            {
                projects.map((p)=> (
                    <Project project={p} />
                ))
            }
        </ul>

     );
}

export default ListProject;
